I'm writing a Rust wrapper around the onnxruntime [C API](https://github.com/microsoft/onnxruntime/blob/master/include/onnxruntime/core/session/onnxruntime_c_api.h) and I have a question regarding the initial values of newly created tensor values. If I'm not mistaken, ```CreateTensorAsOrtValue``` does not zero the memory of the newly created tensor. Specifically, assume that we write something like this (pseudocode):

```rust
let value = api.CreateTensorAsOrtValue(GetAllocatorWithDefaultOptions(), ...);
let mut data = api.GetTensorMutableData(value);
// Can we make any assumptions as to what data[0..] is?
```

I've briefly tested this and it seems that occasionally the data is not zeroed, so I assume it's actually never zeroed and just occasionally zero.

It probably also depends on the chosen memory allocator, so let me narrow down this question to include only the default allocator (```GetAllocatorWithDefaultOptions()```).

**Q:** Are there any guarantees w.r.t. the initial values of the data array? Would it be worth to specifically mention those guarantees in the docs (even / especially if there aren't any)?

PS. I'm aware of ```CreateTensorWithDataAsOrtValue```, but I'm interested specifically in the guarantees of ```CreateTensorWithData```.
